//var IMAGE_ARRAY_WIDTH = 3;
//var IMAGE_ARRAY_HEIGHT = 3;
var IMAGE_ARRAY_WIDTH = 12;
var IMAGE_ARRAY_HEIGHT = 12;
var TILE_SIDE_SIZE = 10;

function day20(input) {
  // Read in tiles
  var tileArray = [];
  
  var readIndex = 0;
  while (readIndex < input.length) {
    var tileNum = input[readIndex].split(" ")[1].split(":")[0];
    var tileData = "";
    readIndex++;
    for (var i = 0; i < TILE_SIDE_SIZE; i++) {
      tileData += input[readIndex];
      readIndex++;
    }
    readIndex++; // Exclude blank line
    tileArray.push({
      "number": tileNum,
      "data": tileData
    });
  }
  
  var remainingTiles = deepCopy(tileArray);
  var placedTiles = {};
  solveForPosition(0, placedTiles, remainingTiles);
  
  console.log("Failure.");
  console.log(tileArray);
}

function solveForPosition(index, placedTiles, remainingTiles) {
  if (index === IMAGE_ARRAY_WIDTH * IMAGE_ARRAY_HEIGHT) {
    console.log(
        "Corners are: "
            + placedTiles[0]["number"] + ", "
            + placedTiles[IMAGE_ARRAY_WIDTH - 1]["number"] + ", "
            + placedTiles[IMAGE_ARRAY_HEIGHT * IMAGE_ARRAY_WIDTH - IMAGE_ARRAY_WIDTH]["number"] + ", "
            + placedTiles[IMAGE_ARRAY_HEIGHT * IMAGE_ARRAY_WIDTH - 1]["number"]);
    console.log("Final image data is:");
    console.log(printFinalResultFromPart1(placedTiles));
    console.log(placedTiles);
    throw "Success!";
  }
  
  // 12x12's corners were:
  //    1097, 3769, 3557, 1019
  
  for (var i = 0; i < remainingTiles.length; i++) {
  //for (var i = remainingTiles.length - 1; i >= 0; i--) { // Can uncomment this to run from both ends with two processes lol
  
  // Keep next line uncommented to reproduce final result quickly in the 12x12 (comment it out for the 3x3)
  if (index === 0) { i = 138; }
  
    // (Reports progress)
    if (index === 0) {
      console.log("Trying for first spot with tile " + i);
    }
    
    var currTile = deepCopy(remainingTiles[i]);
    // Try the 16 variations of the tile:
    //   normal, rotate, rotate, rotate
    //   flip horiz, rotate, rotate, rotate
    //   flip vert, rotate, rotate, rotate
    //   flip horiz, rotate, rotate, rotate
    for (var j = 0; j < 16; j++) {
      if (j === 0) {}
      if (j % 4 > 0) { currTile["data"] = rotate90deg(currTile["data"], TILE_SIDE_SIZE); }
      if (j === 4 || j === 12) { currTile["data"] = flipHorizontally(currTile["data"], TILE_SIDE_SIZE); }
      if (j === 8) { currTile["data"] = flipVertically(currTile["data"], TILE_SIDE_SIZE); }
      // Test:
      if (tileFits(index, placedTiles, currTile["data"])) {
        placedTilesCopy = deepCopy(placedTiles);
        placedTilesCopy[index] = currTile;
        remainingTilesCopy = deepCopy(remainingTiles);
        remainingTilesCopy.splice(i, 1); // Remove used tile from remaining set
        solveForPosition(index + 1, placedTilesCopy, remainingTilesCopy);
      }
    }
  }
}

function tileFits(index, placedTiles, currTileData) {
  if (index % IMAGE_ARRAY_WIDTH !== 0) {
    // Must match right edge of tile to its left
    var leftTileData = placedTiles[index - 1]["data"];
    for (var i = 0; i < TILE_SIDE_SIZE; i++) {
      if (currTileData[i * TILE_SIDE_SIZE] !== leftTileData[((i+1) * TILE_SIDE_SIZE) - 1]) {
        return false;
      }
    }
  }
  if (Math.floor(index / IMAGE_ARRAY_HEIGHT) > 0) {
    // Must match bottom edge of tile above it
    var upperTileData = placedTiles[index - IMAGE_ARRAY_HEIGHT]["data"];
    for (var i = 0; i < TILE_SIDE_SIZE; i++) {
      if (currTileData[i] !== upperTileData[(TILE_SIDE_SIZE * TILE_SIDE_SIZE) - TILE_SIDE_SIZE + i]) {
        return false;
      }
    }
  }
  return true;
}

function rotate90deg(tileData, tileSideSize) {
  var rotatedTile = "";
  for (var x = 0; x < tileSideSize; x++) {
    for (var y = tileSideSize - 1; y >= 0; y--) {
      rotatedTile += tileData[(y * tileSideSize) + x];
    }
  }
  return rotatedTile;
}

function flipHorizontally(tileData, tileSideSize) {
  var rotatedTile = "";
  for (var y = 0; y < tileSideSize; y++) {
    for (var x = tileSideSize - 1; x >= 0; x--) {
      rotatedTile += tileData[(y * tileSideSize) + x];
    }
  }
  return rotatedTile;
}

function flipVertically(tileData, tileSideSize) {
  var rotatedTile = "";
  for (var y = tileSideSize - 1; y >= 0; y--) {
    for (var x = 0; x < tileSideSize; x++) {
      rotatedTile += tileData[(y * tileSideSize) + x];
    }
  }
  return rotatedTile;
}

function printFinalResultFromPart1(placedTiles) {
  var output = "";
  for (var tileY = 0; tileY < IMAGE_ARRAY_HEIGHT; tileY++) {
    for (var y = 1; y < TILE_SIDE_SIZE - 1; y++) {
      for (var tileX = 0; tileX < IMAGE_ARRAY_WIDTH; tileX++) {
        for (var x = 1; x < TILE_SIDE_SIZE - 1; x++) {
          var tileIndex = tileY * IMAGE_ARRAY_HEIGHT + tileX;
          var charIndex = y * TILE_SIDE_SIZE + x;
          output += placedTiles[tileIndex]["data"][charIndex];
        }
      }
    }
  }
  return output;
}

/*

Sea monsters are 3 high and 20 wide

01234567890123456789
.#...#.###...#.##.O#
O.##.OO#.#.OO.##.OOO
#O.#O#.O##O..O.#O##.

*/
function day20Part2(input) {
  var croppedImageWidth = IMAGE_ARRAY_WIDTH * (TILE_SIDE_SIZE - 2);
  var croppedImageHeight = IMAGE_ARRAY_HEIGHT * (TILE_SIDE_SIZE - 2);
  // Try in all 16 positions again:
  for (var j = 0; j < 16; j++) {
    if (j === 0) {}
    if (j % 4 > 0) { input = rotate90deg(input, IMAGE_ARRAY_HEIGHT * (TILE_SIDE_SIZE - 2)); }
    if (j === 4 || j === 12) { input = flipHorizontally(input, IMAGE_ARRAY_HEIGHT * (TILE_SIDE_SIZE - 2)); }
    if (j === 8) { input = flipVertically(input, IMAGE_ARRAY_HEIGHT * (TILE_SIDE_SIZE - 2)); }
    // Test:
    for (var y = 0; y < croppedImageHeight - 2; y++) {
      for (var x = 0; x < croppedImageWidth - 19; x++) {
        var baseline = y * croppedImageWidth + x;
        if (
            input[baseline + 18] === "#"
                && input[baseline + croppedImageWidth + 0] === "#"
                && input[baseline + croppedImageWidth + 5] === "#"
                && input[baseline + croppedImageWidth + 6] === "#"
                && input[baseline + croppedImageWidth + 11] === "#"
                && input[baseline + croppedImageWidth + 12] === "#"
                && input[baseline + croppedImageWidth + 17] === "#"
                && input[baseline + croppedImageWidth + 18] === "#"
                && input[baseline + croppedImageWidth + 19] === "#"
                && input[baseline + croppedImageWidth + croppedImageWidth + 1] === "#"
                && input[baseline + croppedImageWidth + croppedImageWidth + 4] === "#"
                && input[baseline + croppedImageWidth + croppedImageWidth + 7] === "#"
                && input[baseline + croppedImageWidth + croppedImageWidth + 10] === "#"
                && input[baseline + croppedImageWidth + croppedImageWidth + 13] === "#"
                && input[baseline + croppedImageWidth + croppedImageWidth + 16] === "#") {
          // Sea monster found!
          input = replaceCharAt(input, baseline + 18, "O");
          input = replaceCharAt(input, baseline + croppedImageWidth + 0, "O");
          input = replaceCharAt(input, baseline + croppedImageWidth + 5, "O");
          input = replaceCharAt(input, baseline + croppedImageWidth + 6, "O");
          input = replaceCharAt(input, baseline + croppedImageWidth + 11, "O");
          input = replaceCharAt(input, baseline + croppedImageWidth + 12, "O");
          input = replaceCharAt(input, baseline + croppedImageWidth + 17, "O");
          input = replaceCharAt(input, baseline + croppedImageWidth + 18, "O");
          input = replaceCharAt(input, baseline + croppedImageWidth + 19, "O");
          input = replaceCharAt(input, baseline + croppedImageWidth + croppedImageWidth + 1, "O");
          input = replaceCharAt(input, baseline + croppedImageWidth + croppedImageWidth + 4, "O");
          input = replaceCharAt(input, baseline + croppedImageWidth + croppedImageWidth + 7, "O");
          input = replaceCharAt(input, baseline + croppedImageWidth + croppedImageWidth + 10, "O");
          input = replaceCharAt(input, baseline + croppedImageWidth + croppedImageWidth + 13, "O");
          input = replaceCharAt(input, baseline + croppedImageWidth + croppedImageWidth + 16, "O");
        }
      }
    }
    // If sea monsters found, create result:
    if (stringContains(input, "O")) {
      console.log(input);
      var roughWaters = 0;
      for (var i = 0; i < input.length; i++) {
        if (input[i] === "#") {
          roughWaters++;
        }
      }
      console.log("Rough waters: " + roughWaters);
      return;
    }
  }
  console.log("Found nothing?");
}

/** ========== Helper functions ========== */
function arrayContains(inputArr, val) { return inputArr.indexOf(val) !== -1; }
function bin2dec(bin) { return parseInt(bin, 2); }
function dec2bin(dec) { return (dec >>> 0).toString(2); }
function deepCopy(input) { return JSON.parse(JSON.stringify(input)); }
function replaceCharAt(inputStr, index, character) { return inputStr.substr(0, index) + character + inputStr.substr(index + 1); }
function stringContains(inputStr, subStr) { return inputStr.indexOf(subStr) !== -1; }
